import React from 'react';
import './assets/scss/home.scss';

class Home extends React.Component {
    constructor() {
        super();
    };

    handleSubmit = () => {

    }
    handleChange = () => {

    }
    render() {
        return (
            <div>
                <h1 className="header"> Get cash for your vehicle today! </h1>
                <div className="main-row">
                <div className="main-column" id="left-column">
                    <h2 className="header2"> How it works </h2>
                    <ol>
                    <li> ENTER YOUR CARS INFORMATION </li>
                    <li> GET A INSTANT ESTIMATED OFFER </li>
                    <li> GET AN OFFICIAL OFFER WITHIN 24 HOURS </li>
                    <li> CHOOSE PICK-UP OR DELIVERY </li>
                    <li> GET CASH </li>
                    </ol>
                </div>
                <div className="main-column" id="right-column">
                    <h2 className="header"> GET A QUICK CASH OFFER! </h2>
                    <div className="button-container">
                        <form className="vin-form" onSubmit={this.handleSubmit}>
                            <div className="vin-row">
                                <label htmlFor="vin" className="vin-label"> VIN </label>
                                <input type="text" placeholder="Vin" name="vin" maxLength="17" placeholder="17 Digit VIN Number" onChange={this.handleChange} />
                            </div>
                            <div className="vin-row">
                                <div className="vin-column">
                                    <label htmlFor="miles" className="vin-label"> Miles </label>
                                    <input type="number" placeholder="Must be a number" onChange={this.handleChange}/>
                                </div>
                                <div className="vin-column">
                                    <label htmlFor="zip" className="vin-label"> Zip Code </label>
                                    <input type="number" placeholder="Must be a 5 digit number" maxLength="5" onChange={this.handleChange}/>
                                </div>
                            </div>
                            <button className="main-button"> GET OFFER </button>
                        </form>
                    </div>

                </div>
                </div>
            </div>
        )
    }
}

export default Home;
